// === Timer === //
(function () {
  const second = 1000,
        minute = second * 60,
        hour = minute * 60,
        day = hour * 24;

  //I'm adding this section so I don't have to keep updating this pen every year :-)
  //remove this if you don't need it
  let today = new Date(),
      dd = String(today.getDate()).padStart(2, "0"),
      mm = String(today.getMonth() + 1).padStart(2, "0"),
      yyyy = today.getFullYear(),
      nextYear = yyyy + 1,
      dayMonth = "06/01/",
      event = dayMonth + yyyy;
  
  today = mm + "/" + dd + "/" + yyyy;
  if (today > event) {
    event = dayMonth + nextYear;
  }
  //end
  
  const countDown = new Date(event).getTime(),
      x = setInterval(function() {    

        const now = new Date().getTime(),
              distance = countDown - now;

        document.getElementById("day").innerText = Math.floor(distance / (day)),
          document.getElementById("hour").innerText = Math.floor((distance % (day)) / (hour)),
          document.getElementById("minute").innerText = Math.floor((distance % (hour)) / (minute)),
          document.getElementById("second").innerText = Math.floor((distance % (minute)) / second);

        //do something later when date is reached
        if (distance < 0) {
          document.getElementById("headline").innerText = "Booking Ends!";
          document.getElementById("countdown").style.display = "none";
          document.getElementById("content").style.display = "block";
          clearInterval(x);
        }
        //seconds
      }, 0)
  }());

//Popover
$(document).ready(function() {
  $(".popover-cls").popover({
          trigger: "manual",
          html: true,
          animation: false,
          content: function() {
              return '<div class="popover-loader">' +
                  '<p>loader</p>' +
                  '</div>' +
                  '<div class="media popover-media">' +
                  '<img class="img-fluid user-img" src="' + $(this).data('img') + '" />' +
                  '<div class="media-body">' +
                  '<h4>' +
                  $(this).data('name') +
                  '</h4>' +
                  '<h6><img src="../assets/svg/users.svg" class="img-fluid">30 mutual friend</h6>' +
                  '<h6><img src="../assets/svg/map-pin.svg" class="img-fluid">lives in london</h6>' +
                  '</div>' +
                  '</div>' +
                  '<div class="button-popover">' +
                  '<a href="#" class="btn btn-solid"><img src="../assets/svg/message-square.svg" class="img-fluid">message</a>' +
                  '<a href="#" class="btn btn-solid"><img src="../assets/svg/user-check.svg" class="img-fluid mr-0"></a>' +
                  '</div>';
          }
      })
      .on("mouseenter", function() {
          $('.popover-loader').addClass('show');
          setTimeout(function() {
              $('.popover-loader').removeClass('show');
          }, 1000);
          var _this = this;
          $(this).popover("show");
          $(".popover").on("mouseleave", function() {
              $(_this).popover('hide');
          });
      }).on("mouseleave", function() {
          var _this = this;
          setTimeout(function() {
              if (!$(".popover:hover").length) {
                  $(_this).popover("hide");
              }
          }, 10);
      });

});

